class Services extends Component {
    render(){
        return(
            <div className="services-page">
                <h1>Servicios</h1>

                <div className="services-card">
                <span>
                    <h3>Consultation</h3>
                </span>
                <span>
                    <h3>Design</h3>
                </span>
                <span>
                    <h3>Renovation</h3>
                </span>
                </div>
                <div className="services-card">
                <span>
                    <h3>Staging</h3>
                </span>
                <span>
                    <h3>Deco-Kids</h3>
                </span>
                <span>
                    <h3>Commercial</h3>
                </span>
                </div>
                <style jsx>{`
                    .services-page {
                        display: fixed;
                        margin-top: 25vh;
                    }
                    .services-page h1 {
                        justify-self: center;
                        text-align: center;
                        vertical-align: center;
                    }
                    .services-card {
                        diplay: flex;
                        flex-direction: row;
                        margin: 10px;
                        flex-wrap: wrap;
                    }
                    `}</style>
                </div>
        )
    }
}

export default Services
